import React from 'react';

const filterPrice = props => (
    <div className="maxMin">
      <label>Min </label>
      <input type={props.type} label="Filter" placeholder="Min" />
      <label>Max </label>
      <input type={props.type} label="Filter" placeholder="Max" />
    </div>
  );

export default filterPrice;
